import React from "react";
import BackButton from "./Buttons/BackButton";
import Zoom from "@material-ui/core/Zoom";
import UpButton from "./Buttons/UpButton";
import { MainDiv, StyledPaper, ItalicText } from "./styles/ContentPages";
import { LinksDiv, LinkImg, LinkImgMiddle } from "./styles/Links";

import styled from "styled-components";
import Paper from "@material-ui/core/Paper";

const GreenHyperlink = styled.a`
  color: #6e7c5e;
`;

const ProjectPaper = styled(Paper)`
  width: 90%;
  margin-top: 3em;
  background-color: #faf9f8;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  margin-bottom: 1em;
`;

const TextDiv = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
`;
export const ProjectTitle = styled.h1`
  color: #000000;
  font-weight: 400;
  font-size: 4em;
  text-align: center;

  margin: 0em;
  @media (max-width: 768px) {
    font-size: 3em;
  }
`;

const ProjectImg = styled.img`
  height: 32vh;
  width: 48vh;
  border-radius: 2%;
  margin-bottom: 1em;

  @media (max-width: 768px) {
    height: 20vh;
    width: 30vh;
  }
`;

export const ProjectText = styled.p`
  color: #353336;
  font-size: 2em;

  font-weight: 300;
  margin: 1em;
  margin-top: 0em;
  @media (max-width: 768px) {
    font-size: 1em;
  }
`;

export default function Bio(props) {
  return (
    <MainDiv>
      <BackButton onClick={() => props.transition("MENU")} />
      <Zoom in={true}>
        <StyledPaper>
          <ProjectPaper elevation={12}>
            <TextDiv>
              <ProjectTitle>SETTLE</ProjectTitle>
              <LinksDiv>
                <a
                  href="https://github.com/janeszelag"
                  target="_blank"
                  rel="noopener noreferrer"
                >
                  <LinkImg
                    alt="github"
                    src="https://res.cloudinary.com/dpfixnpii/image/upload/v1583345284/github_kamxct.svg"
                  />
                </a>

                <a
                  href="https://www.canva.com/design/DADyKHdsUv0/_q5BVefQa8GfiP0l0orK-g/view?utm_content=DADyKHdsUv0&utm_campaign=designshare&utm_medium=link&utm_source=sharebutton"
                  target="_blank"
                  rel="noopener noreferrer"
                >
                  <LinkImgMiddle
                    alt="resume"
                    src="https://res.cloudinary.com/dpfixnpii/image/upload/v1583345272/document_xtuk0s.svg"
                  />
                </a>
              </LinksDiv>
              <ProjectImg
                alt="settle"
                src="https://res.cloudinary.com/dpfixnpii/image/upload/v1583451000/Screen_Shot_2020-03-05_at_6.29.19_PM_tnhxeo.png"
              />
              <ProjectText>
                <strong>ABOUT:</strong> Settle is a wellness application that
                aims to help secondary-students manage and cope with the
                symptoms of Test Anxiety. Settle introduces teens to the
                practice of mindfulness, while also empowering them with the
                tools and knowledge they need to modify the dysfunctional
                patterns of thinking associated with anxiety. User activity is
                saved and analyzed in order track/display progress.
                <br />
                <strong>TECH STACK:</strong> React, React Router, Rails API,
                Axios, Styled-components, Material-UI, ApexCharts, JWT
              </ProjectText>
            </TextDiv>
          </ProjectPaper>
          <ItalicText>
            The git repository for this website can be found{" "}
            <GreenHyperlink
              href="https://github.com/janeszelag/resumesite"
              target="_blank"
              rel="noopener noreferrer"
            >
              here.
            </GreenHyperlink>
          </ItalicText>
          <UpButton onClick={() => props.scrollUp()} />
        </StyledPaper>
      </Zoom>
    </MainDiv>
  );
}
